import { Box, Typography, Button } from "@mui/material";
import NavigationBar from "./NavigationBar";
import DateRangeIcon from "@mui/icons-material/DateRange";

export default function NewPage() {
  const [selectedDate, setSelectedDate] = React.useState("January 22, 2025");

  const handleChangeDate = () => {
    // Logic to change the date (e.g., open a date picker)
    console.log("Change date clicked");
  };

  return (
    <>
      {/* Navigation Bar */}
      <NavigationBar />

      {/* Selected Date with Change Option */}
      <Box
        sx={{
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          marginTop: 2,
        }}
      >
        <Typography variant="body1" fontWeight="bold">
          Selected Date: {selectedDate}
        </Typography>
        <Button
          startIcon={<DateRangeIcon />}
          sx={{ marginLeft: 1, textTransform: "capitalize" }}
          onClick={handleChangeDate}
        >
          Change
        </Button>
      </Box>

      {/* Listings */}
      <Box sx={{ padding: 4 }}>
        <Box sx={{ display: "flex", gap: 2, flexWrap: "wrap", justifyContent: "center" }}>
          {[1, 2, 3, 4, 5].map((item) => (
            <Box
              key={item}
              sx={{
                width: 300,
                backgroundColor: "#fff",
                padding: 2,
                borderRadius: 2,
                boxShadow: 1,
                textAlign: "center",
              }}
            >
              <Box
                sx={{
                  width: "100%",
                  height: 200,
                  backgroundColor: "#ccc",
                  borderRadius: 2,
                  marginBottom: 2,
                }}
              />
